import React from 'react';
import {faFacebook} from '@fortawesome/free-brands-svg-icons';
import {faGithub} from '@fortawesome/free-brands-svg-icons';
import {faYoutube} from '@fortawesome/free-brands-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {Link} from 'react-router-dom';

function HomePage() {
    return (
        <div className="HomePage">
            <header className="hero">
                <h1 className="hero-text">
                    Hi, I am 
                    <span> Karimli Karim.</span>
                </h1>
                <p className="h-sub-text">
                As a Frond-End React Developer, I offer you 1.5 years of experience in creating effective web solutions for various industry organizations, also, has experience in designing, developing and testing a variety of web applications, including a range of technologies.
                </p>
                <div className="icons">
                    {/* <Link to="test" className="icon-holder">
                        <FontAwesomeIcon icon={faFacebook} className="icon fb" />
                    </Link> */}
                    <p>GitHub </p> <span> : </span>
                    <a href="https://github.com/KarimLeeKarim" className="icon-holder">
                        <FontAwesomeIcon icon={faGithub} className="icon gh" />
                    </a>
                    {/* <Link to="test" className="icon-holder">
                        <FontAwesomeIcon icon={faYoutube} className="icon yt"/>
                    </Link> */}
                </div>
            </header>
        </div>
    )
}

export default HomePage;
